import React from 'react';
import styled from 'styled-components';
import ProfileLevel3 from './ProfileLevel3';

function ProfilePage() {
	return (
		<ComponentWrapper>
			<ProfileLevel3 />
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
`;

export default ProfilePage;
